  \"2016-03-21T19:58:53.959768\",\n\t\"name\": \"lgr-adult-trap-data-operation-of-the-adult-trap-at-lower-granite-dam\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Bonneville Power Administration (BPA)
  - funded project pays for NOAA staff to operate the adult salmon trap located in
  the fish ladder at Lower Granite Dam. The trap is operated to provide access to
  fish for sampling for several NOAA projects as well as other researchers from many
  agencies. The trap is used for random sampling of adults used in run reconstructions,
  determining age classes of returning adults, assess injuries from marine mammals,
  brood stock collection for hatcheries, scale sampling to determine age of ocean
  entry for fall Chinook, radio tagging of adults, and various other uses. NOAA has
  operated this trap since it was built in the mid-1970s, with BPA funding beginning
  in 2006. An annual report is provided to BPA summarizing trap activities.nnLower
  Granite Dam adult trap data.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
